import React, { useState, useEffect } from 'react'
import axios from 'axios'

const MarvelCharacters = () => {
  const [marvelCharactersList, setMarvelCharactersList] = useState([])

  useEffect(async () => {
    const result = await axios(
      'https://gateway.marvel.com:443/v1/public/characters?apikey=d1925cd3b431b62ac236c00d3c681015'
    )
    setMarvelCharactersList(result.data)
  }, [])

  return (
    <ul>
      {marvelCharactersList?.map(item => (
        <li key={item.name}>
          <p>{item.name}</p>
          <p>{item.description}</p>
          <img src={item.comics}></img>
        </li>
      ))}
    </ul>
  )
}

export default MarvelCharacters
